#!/usr/bin/env python3
from itertools import product

YES = "Yes"  # type: str
NO = "No"  # type: str


# Generated by 2.12.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    N = 3
    SIZE = 4
    P = [[] for _ in range(N)]
    for i in range(N):
        for _ in range(SIZE):
            P[i].append(input())

    def get_poly_pos_list(p):
        pos_list = []
        base_pos = None
        for r, line in enumerate(p):
            for c, value in enumerate(line):
                if value == "#":
                    if base_pos is None:
                        base_pos = (c, r)
                    pos_list.append((c - base_pos[0], r - base_pos[1]))
        return pos_list

    def get_poly_search_list():
        search_rot = [0,1,2,3]
        search_x_slide = [0,1,2,3]
        search_y_slide = [0,1,2,3]
        return list(product(search_rot, search_x_slide, search_y_slide))

    poly_pos = [get_poly_pos_list(p) for p in P]
    searches = get_poly_search_list()

    def transform(poly_pos, pattern):
        n_rot, sx, sy = pattern
        def rotate(x, y, n_rot):
            nx, ny = x, y
            for _ in range(n_rot):
                nx, ny = -ny, nx
            return nx, ny

        trans_pos = []
        for x, y in poly_pos:
            nx, ny = rotate(x, y, n_rot)
            nx += sx
            ny += sy
            trans_pos.append((nx, ny))
        return trans_pos

    def is_out(poly_pos):
        for x, y in poly_pos:
            if x < 0 or y < 0 or x >=SIZE or y >= SIZE:
                return True
        return False

    def process(patterns):
        field = [[0] * SIZE for _ in range(SIZE)]
        for i in range(N):
            trans_pos = transform(poly_pos[i], patterns[i])
            if is_out(trans_pos):
                return False
            for x, y in trans_pos:
                field[y][x] += 1
        for i in range(SIZE):
            for j in range(SIZE):
                if field[i][j] != 1:
                    return False
        return True

    for patterns in product(searches, searches, searches):
        if process(patterns):
            print(YES)
            return
    print(NO)

if __name__ == '__main__':
    main()
